demo.repl.help:
Comandos disponíveis:
  @show              ─ exibe o resumo do último cartão adaptativo
  @json              ─ emite o valor JSON bruto recebido do fluxo
  @back              ─ volta para o cartão/entradas bloqueados anteriores
  @input <k>=<v>     ─ define ou substitui um campo de entrada
  @click <action_id> ─ envia o cartão com a ação informada
  @help              ─ imprime esta ajuda
  @quit              ─ sai do REPL
